function Header() {
    return (
        <>
            <ul className={styles.menus}>
                {
                    <li>
                        <Link to='/'>Home</Link>
                        <Link to='/'>Add Restaurant</Link>
                        <Link to='/'>Edit Restaurant</Link>
                    </li>
                }
            </ul>
        </>
    );
}

export default Header;
